import home from './imagenes/home.png';
import './App.css';
import Button from 'react-bootstrap/Button';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Inicio from './inicio';
import Proyectos from './projectos';
import Contacto from './contacto';



function App() {
  return (
    <Router>
    <div className="img">
   <img src= {home}/>
   <div className="container mt-5">
     </div>
   <div className="btn-group">
     <Link to="/" className="btn btn-dark">
     Inicio
     </Link>
     <Link to="/contacto" className="btn btn-dark">
     Contacto
     </Link>
     <Link to="/proyecto" className="btn btn-dark">
     Proyectos
     </Link>

   </div>
   </div>
   <Switch>
     <Route path="/inicio">
       <Inicio></Inicio>
     </Route>
     <Route path="/proyectos">
<Proyectos></Proyectos>
     </Route>
     <Route path="/contacto">
<Contacto></Contacto>
     </Route>
     </Switch>
   </Router>

  )
   }


export default App;
